import React from "react";
import Footer from "../components/Footer";
import Header from "../components/Header";

const Project = () => {
  return (
    <div>
      <Header />
      <div className="project">
        <div className="pr1">
          <h1>Projects</h1>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default Project;
